      },
      {
        path: 'SearchItems',
        name: 'SearchItems',
        component: () => import('@/views/MainView/SearchItemsView/SearchItemsView.vue')
      },
      {
        path: 'SwapHistory',
        name: 'SwapHistory',
        component: () => import('@/views/MainView/SwapHistoryView/SwapHistoryView.vue')
      },
      {
        path: 'UpdateMyInfo',
        name: 'UpdateMyInfo',
        component: () => import('@/views/MainView/UpdateMyInfoView/UpdateMyInfoView.vue')
      }
    ]
  }, {
    path: '/play',
    name: 'play',
    component: () => import(/* webpackChunkName: "about" */ '../views/PlayGround.vue')
  }
]

const router = createRouter({
  history: createWebHashHistory(),
  routes
})

export default router
